import { Placeholder } from "react-bootstrap";

export const PersonalInfo = [
    {
        section: 1,
        items: [
            {
                label: 'First name',
                type: 'text',
                value: 'First name',
            },
            {
                label: 'Last name',
                type: 'text',
                value: 'Last name',
            },
            {
                label: 'Email address',
                type: 'text',
                value: 'Email address',
            },
            {
                label: 'Phone number',
                type: 'text',
                value: 'Phone number',
            }
        ]
    },

    {
        section: 2,
        items: [
            {

                label: 'Expert',
                type: 'select',
                options: ['John Doe', 'Jane Doe', 'Sofia Hayes', 'Jeffrey Ramirez']
            },
            {
                label: 'Service',
                type: 'select',
                options: ['Himalayan Salt Treatment', 'Detox and cellulite treatment', 'Foot care', 'Cleansing Facial', 'Facial Gua Sha', 'Anti-aging facial treatment', 'Keratin Treatment', 'Lashes and brows', 'Laser Hair Removal'],
            },
            {
                label: 'Date and time',
                type: 'text'
            }
        ]
    },
    {
        section: 3,
        items:[
            {
                label: 'If you are ready to submit please press `Submit`',
                type: 'information',
            }
        ]
    }

]
